import React from 'react';
import PropTypes from 'prop-types';

import { Panel, PanelHeader, ModalCard, Button, ModalRoot} from '@vkontakte/vkui';

import './user_menu.css';
import {Icon56MoneyTransferOutline} from "@vkontakte/icons";

const User_menu = props => (
	<Panel id={props.id}>
		<PanelHeader></PanelHeader>
		<Button onClick={() => props.changeActiveModal("more_info")}>
			Открыть модальные карточки
		</Button>
		<ModalRoot activeModal={props.activeModal} onClose={null}>
			<ModalCard
				id="more_info"
				onClose={() => props.changeActiveModal(null)}
				icon={<Icon56MoneyTransferOutline />}
				header="Отправляйте деньги друзьям, используя банковскую карту"
				subheader="Номер карты получателя не нужен — он сам решит, куда зачислить средства."
				actions={
					<Button
						size="l"
						mode="primary"
						stretched
						onClick={() => props.changeActiveModal(null)}
					>
						Попробовать
					</Button>
				}
			></ModalCard>
		</ModalRoot>

	</Panel>
);

User_menu.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	activeModal: PropTypes.string.isRequired,
	changeActiveModal: PropTypes.func.isRequired,
};

export default User_menu;
